import './App.css';

async function App() {
  const res = await fetch(`https://dummyjson.com/products?limit=100`)

  const fetchData = async () => {
    const res = await fetch(`https://dummyjson.com/products?limit=100`)
    const data = await res.json()
    console.log(data)
  }



}

export default App;
